import React from 'react'
import './header.css'
import {BsLightbulbFill,BsFillLightbulbOffFill} from 'react-icons/bs';
const Header = () => {
  return (
    <div className='header_css'>
       
        <h1 className='logo_css'>Memo</h1>
         <span className='icon_css'> <BsFillLightbulbOffFill/></span>
        

    </div>

  )

}

export default Header
